import React from 'react';
import styles from './practicalForm.module.css';

class PracticalForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }
    }

    render() {
        return (
            <div className={styles['practicalForm']}>
                <h2>Your Practical Experience:</h2>
                <form className={styles['practicalForm']}>
                    <div className={styles['work']}>
                        <h3>Work Experience</h3>
                        <div className={styles['company']}>
                            <label
                              className={styles['label']}
                              htmlFor="companyInput">
                                Company:
                            </label>
                            <input
                              className={styles['input']}
                              placeholder="Company"
                              name="companyInput"
                              id="companyInput"
                              type="text"
                              required>
                            </input>
                        
                        
                        </div>
                    </div>
                </form>
            </div>
        )
    }
}

export default PracticalForm;
